import { Link } from 'react-router-dom';

import classes from '.MainNavigation.module.css';


function MainNavigation(){
    return <header>
        <nav>
            <ul>
                <li><Link to="/"/>Home</li>
                <li><Link to="/products"/>Products</li>

            </ul>
        </nav>
    </header>
}

export default MainNavigation;
